#include <misc.h>
#include <params.h>

module cloudbrain_convo_module
use shr_kind_mod,    only: r8 => shr_kind_r8
use ppgrid,          only: pcols, pver, pverp
use history,         only: outfld, addfld, add_default, phys_decomp
use physconst,       only: gravit,cpair
implicit none

save

private                         ! Make default type private to the module
integer,parameter :: nbneurons = 32
integer, parameter ::nbhiddenlayers = 6
integer,parameter :: nlev = 21 ! Only the bottom this-many levels are used in the neural net.
integer,parameter :: nchannel_in = 7 ! Input variables 

integer,parameter :: nchannel_out = 2 ! Output variables 

public cloudbrain_convo

contains 

subroutine cloudbrain_convo(TAP, QAP, OMEGA, SHFLX, LHFLX, dTdt_adiabatic, dQdt_adiabatic, SPDT, SPDQ)

real(r8), intent(in) :: TAP(pver)
real(r8), intent(in) :: QAP(pver)
real(r8), intent(in) :: OMEGA(pver)
real(r8), intent(in) :: SHFLX
real(r8), intent(in) :: LHFLX
real(r8), intent(in) :: dTdt_adiabatic(pver)
real(r8), intent(in) :: dQdt_adiabatic(pver)
real(r8), intent(out) :: SPDT(pver) ! W/kg
real(r8), intent(out) :: SPDQ(pver) ! W/kg
real(r8) :: input(nlev,nchannel_in)
real(r8) :: input_padded(nlev+2,nchannel_in)
real(r8) :: interior_input_padded(nlev+2,nbneurons)
real(r8) :: new_state (nlev,nbneurons)
real(r8) :: conv2d_input_kernel(3,nchannel_in,nbneurons)
real(r8) :: conv2d_input_bias(nbneurons)
real(r8) :: conv2d_current_interior_kernel(3,nbneurons,nbneurons)
real(r8) :: conv2d_current_interior_bias(nbneurons)
real(r8) :: conv2d_outer_kernel (nbneurons,nchannel_out)
real(r8) :: conv2d_outer_bias (nchannel_out)
real(r8) :: out_state (nlev,nchannel_out)
real(r8) :: meanvect(nlev),stdvect(nlev) ! tmp buffers for var-specific normalization vectors. 
integer :: ilayer,k,kchan,jnewchan,kfilt 

! ------- neural net input matrix & normalization ----
meanvect(:)= (/ 1.976259e+02,2.051121e+02,2.132837e+02,2.219409e+02,2.308598e+02,2.398378e+02,2.486405e+02,2.569020e+02,2.645600e+02,2.717415e+02,2.781952e+02,2.835761e+02,2.874984e+02,2.898036e+02,2.915453e+02,2.928478e+02,2.941891e+02,2.955860e+02,2.970650e+02,2.984884e+02,2.998220e+02 /) 
stdvect(:)= (/ 1.196686e+00,9.284656e-01,8.392079e-01,8.866482e-01,9.797458e-01,1.086315e+00,1.116961e+00,1.115210e+00,1.012263e+00,8.841199e-01,9.086341e-01,9.509586e-01,1.061562e+00,1.195689e+00,1.281831e+00,1.246550e+00,1.160493e+00,1.011867e+00,9.069132e-01,9.086423e-01,9.273534e-01 /) 
input(:,1)= (TAP((pver-nlev+1):pver) - meanvect)/stdvect 
meanvect(:)= (/ 2.669572e-06,8.115477e-06,2.460760e-05,6.361641e-05,1.421861e-04,2.938007e-04,5.619368e-04,1.023388e-03,1.816948e-03,3.013680e-03,4.578468e-03,6.546592e-03,9.004862e-03,1.168765e-02,1.340703e-02,1.459734e-02,1.578751e-02,1.687895e-02,1.754783e-02,1.792011e-02,1.810745e-02 /) 
stdvect(:)= (/ 1.213905e-06,4.066391e-06,1.206239e-05,3.292698e-05,8.429087e-05,2.013921e-04,4.209231e-04,7.475399e-04,1.221900e-03,1.840035e-03,2.467918e-03,2.936002e-03,2.935736e-03,2.113178e-03,1.535425e-03,1.308593e-03,1.166542e-03,1.212049e-03,1.384544e-03,1.519896e-03,1.529678e-03 /) 
input(:,2)= (QAP((pver-nlev+1):pver) - meanvect)/stdvect 
meanvect(:)= (/ -1.634676e-03,-3.725742e-03,-7.228229e-03,-1.136411e-02,-1.460619e-02,-1.610080e-02,-1.617307e-02,-1.600734e-02,-1.627409e-02,-1.689405e-02,-1.747652e-02,-1.771672e-02,-1.775468e-02,-1.761526e-02,-1.736640e-02,-1.699524e-02,-1.587534e-02,-1.317547e-02,-9.431073e-03,-5.737487e-03,-2.484269e-03 /) 
stdvect(:)= (/ 2.958732e-02,4.263658e-02,5.949027e-02,7.955774e-02,9.937307e-02,1.149599e-01,1.226969e-01,1.226992e-01,1.201588e-01,1.206594e-01,1.248092e-01,1.276393e-01,1.283527e-01,1.271780e-01,1.223049e-01,1.107766e-01,9.250671e-02,7.003353e-02,4.738424e-02,2.732615e-02,1.335026e-02 /) 
input(:,3)= (OMEGA((pver-nlev+1):pver) - meanvect)/stdvect 
input(:,4) = (SHFLX-7.475819e+00)/5.462161e+00
input(:,5) = (LHFLX-1.278391e+02)/5.544951e+01
meanvect(:)= (/ -2.845587e-06,-1.202878e-06,4.655082e-07,1.609062e-07,-3.380687e-06,-7.953769e-06,-1.072213e-05,-1.138314e-05,-1.145226e-05,-1.077539e-05,-9.728259e-06,-9.454307e-06,-8.139930e-06,-2.260499e-06,-6.837711e-06,-9.683226e-06,-1.200262e-05,-1.233239e-05,-1.001548e-05,-6.078719e-06,-5.707102e-06 /) 
stdvect(:)= (/ 2.888658e-05,2.759167e-05,2.949006e-05,3.496148e-05,4.535195e-05,6.208232e-05,7.830353e-05,8.994209e-05,9.303480e-05,8.829273e-05,8.237847e-05,7.755071e-05,7.671444e-05,7.170842e-05,7.083175e-05,5.932680e-05,4.679221e-05,3.485421e-05,2.501752e-05,1.999227e-05,2.328915e-05 /) 
input(:,6)= (dTdt_adiabatic((pver-nlev+1):pver) - meanvect)/stdvect 
meanvect(:)= (/ 1.542890e-11,7.045801e-11,2.681689e-10,8.320419e-10,2.075862e-09,3.671585e-09,4.445881e-09,4.581800e-09,4.327374e-09,4.295288e-09,5.064719e-09,5.888829e-09,4.260335e-09,-2.183689e-09,-1.909106e-09,-1.955543e-09,-3.154676e-09,-2.961484e-09,-3.630049e-09,-8.740341e-09,-1.046502e-08 /) 
stdvect(:)= (/ 7.049748e-11,2.754031e-10,9.014017e-10,2.544900e-09,6.247197e-09,1.221451e-08,1.864489e-08,2.511090e-08,2.911215e-08,3.212515e-08,3.645002e-08,4.224572e-08,4.797513e-08,5.069195e-08,5.331032e-08,4.989187e-08,4.615041e-08,3.773099e-08,2.902741e-08,1.951266e-08,1.689416e-08 /) 
input(:,7)= (dQdt_adiabatic((pver-nlev+1):pver) - meanvect)/stdvect 
! ------- input layer, define underlying matrices: ----
call get_inputlayer_data (conv2d_input_bias,conv2d_input_kernel)

! ------- input layer, pad and do the magic:
input_padded(1,:) = input(1,:)
input_padded(2:(nlev+1),:) = input(:,:)
input_padded((nlev+2),:) = input(nlev,:)
! ---- Go from 23x7 padded input to 21x32 for first dense layer
new_state(:,:) = 0.
do jnewchan = 1,nbneurons 
  do kchan = 1,nchannel_in 
    do k = 2,nlev+1 
      do kfilt = 1,3 
        new_state(k-1,jnewchan) = new_state(k-1,jnewchan) + input_padded(k+kfilt-2,kchan)*conv2d_input_kernel(kfilt,kchan,jnewchan)
      end do
    end do
  end do
! --- Apply bias and then leaky relu activation function:
  do k=1,nlev 
    new_state(k,jnewchan) = new_state(k,jnewchan) + conv2d_input_bias(jnewchan)
    if (new_state(k,jnewchan) .lt. 0.) then
      new_state(k,jnewchan) = new_state(k,jnewchan)*0.3
    end if
  end do
end do
! ---- NOW do the same as above but for an outer loop over all the hidden layers:
! ---- in each step, we go from a 21x32 --> 23x32 padded --> (net matrices) --> the next 21x32 --> its bias, activation :
do ilayer = 1,nbhiddenlayers-1 
  call get_hiddenlayer_data (ilayer,conv2d_current_interior_bias,conv2d_current_interior_kernel)
  interior_input_padded(1,:) = new_state(1,:)
  interior_input_padded(2:nlev+1,:) = new_state(:,:)
  interior_input_padded(nlev+2,:) = new_state(nlev,:)
! ---- Go from 23x32 padded input to current dense layer to 21x32 for new_state that will arrive at next dense layer
  new_state(:,:) = 0. ! nlev x nbneurons 
  do jnewchan = 1,nbneurons 
    do kchan = 1,nbneurons 
      do k = 2,nlev+1 
        do kfilt = 1,3 
          new_state(k-1,jnewchan) = new_state(k-1,jnewchan) + interior_input_padded(k+kfilt-2,kchan)*conv2d_current_interior_kernel(kfilt,kchan,jnewchan)
        end do
      end do
    end do !kchan
! --- Apply bias and then leaky relu activation function:
    do k=1,nlev 
      new_state(k,jnewchan) = new_state(k,jnewchan) + conv2d_current_interior_bias(jnewchan)
      if (new_state(k,jnewchan) .lt. 0.) then
        new_state(k,jnewchan) = new_state(k,jnewchan)*0.3
      end if
    end do
  end do !jnewchan 
end do !ilayer 


! ---- Finally, for the outer layer, we go from 21x32 --> (no padding) --> (net matrices) --> the outer (2x21) --> its bias, NO activation :
call get_outerlayer_data (conv2d_outer_bias,conv2d_outer_kernel)
out_state(:,:) = 0. ! nlev x nchannel_out 
do jnewchan = 1,nchannel_out 
  do kchan = 1,nbneurons 
    do k=1,nlev 
      out_state(k,jnewchan) = out_state(k,jnewchan) + new_state(k,kchan)*conv2d_outer_kernel(kchan,jnewchan)
    end do
  end do !kchan
! --- Apply bias but NO activation function:
  do k=1,nlev 
    out_state(k,jnewchan) = out_state(k,jnewchan) + conv2d_outer_bias(jnewchan)
  end do
end do ! jnewchan


! links to subroutine outputs: 
SPDT(:) = 0.
SPDT((pver-nlev+1):pver) = out_state(:,1)
SPDQ(:) = 0.
SPDQ((pver-nlev+1):pver) = out_state(:,2)
SPDQ = SPDQ/2.501000e+06  ! W/kg --> kg/kg/s, expected by ptend structure.
end subroutine cloudbrain_convo


